import React, { Component } from 'react'

export default class Header extends Component {
  render() {
    return (
      <header>
        <div>
          <h3>Caroline Nunes</h3>
        </div>
        <section>
          <li><a>Home</a></li>
          <li><a>Sobre Mim</a></li>
          <li><a>Skills</a></li>
          <li><a>Projetos</a></li>
          <li>Contato</li>
        </section>
      </header>
    )
  }
}
